iOS/Performance.html.body:
Performance Optimize
对象的创建和销毁
利用Autorelease Pool创建临时对象
当要创建大量临时对象时，可以显示创建Autorelease Pool即时销毁对象节省内存，而不用等待系统自带的Autorelease Pool执行时销毁;
@autoreleasepool {
  for (int i = 0;i 
异步销毁对象
当数据源非常大的时候(如UITalbleView)，销毁对象累计起来也非常耗费资源,可以异步销毁对象：
TestModel *model = [[TestModel alloc] init];
model.title = @"ass";
model.name = @"hole";
TestModel *temp = model;
model = nil;
dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    [temp class];
});

当给model赋值nil时，由于model所指向内存中的实际对象被temp强引用，所以该对象不会被销毁，[temp class]在后台线程调用，temp作为临时变量block执行结束后便被销毁，所指向的对象会在后台线程销毁，于是便达到了使model所指对象在后台线程销毁的目的,同时可以避免编译器警告。
图像的加载与绘制
加载图片
[UIImage imageNamed:]和[UIImage imageWithContentsOfFile:]两种加载图片方式的不同在于后者只会简单的加载文件而不会对图片进行缓存，所以在UITableView中大量使用[UIImage imageNamed:]对内存的消耗是非常感人的，除非是对于重复使用的图片使用[UIImage imageNamed:]，可以减少文件IO操作；
但是[UIImage imageWithContentsOfFile:]有一个缺点是不能自动选择加载@2x/@3x的图片，所以可以定义如下宏定义来解决:
#define UPUncachedPNGImage(imageName) [UIImage imageWithContentsOfFile:[[NSBundle mainBundle] pathForResource:[NSString stringWithFormat:@"%@@%zdx",imageName,@([UIScreen mainScreen].scale).integerValue] ofType:@"png"]]

#define UPCachedImage(imageName) [UIImage imageNamed:imageName]

tableViewCell.imageView.image = UPUncachedPNGImage(@"image");

绘制图片
由于CoreGraphic是线程安全的，所以可以异步手动绘制,可以同时减少CPU和GPU的消耗，常用语UITableViewCell中图片的绘制:
- (void)displayImage {
    dispatch_async(backgroundQueue, ^{
        CGContextRef ctx = CGBitmapContextCreate(...);
        // draw in context...
        CGImageRef img = CGBitmapContextCreateImage(ctx);
        CFRelease(ctx);
        dispatch_async(mainQueue, ^{
            layer.contents = img;
        });
    });
}

同理利用CoreText异步绘制文字。
离屏渲染
On-Screen Rendering
: GPU的渲染操作是在当前用于显示的屏幕缓冲区进行.
Off-Screen Rendering (离屏渲染)
: GPU在当前屏幕缓冲区以外开辟一个缓冲区进行渲染操作.
CALayer 的 border、圆角、阴影、遮罩（mask），CASharpLayer 的矢量图形显示，通常会触发离屏渲染（offscreen rendering）从而影响画面流畅性，在UITableViewCell中尽量避免离屏渲染。
绘制圆角
通常情况下只给CALayer设置cornerRadius并不会触发离屏渲染，但是如果将masksToBounds设置为YES却会触发离屏渲染，若出现必须要使用masksToBounds的场景，可以手动绘制圆角:
高效添加圆角效果
绘制阴影
绘制阴影效果时，为layer指定shadowPath可以避免Offscreen-Rendered:
view.layer.shadowPath = [UIBezierPath  bezierPathWithRect:view.bounds].CGPath;

光栅化
对于 内容相对固定重复 的内容，开启光栅化会将图层渲染为一个屏幕之外的位图(bitmap)，然后将这个位图缓存起来，这样可以减少GPU绘制压力，提高性能，常用与UITableView,UICollectionView,UIScrollView等.
光栅化性能最好的方式是是开启 cell 的 shouldRasterize，并将 rasterizationScale 设置为 UIScreen.main.scale。如果设置cell.layer.rasterizationScale = cell.layer.contentsScale则会出现视图模糊的现象。
cell.layer.shouldRasterize = YES;
cell.layer.rasterizationScale = UIScreen.main.scale;

若 cell 中有多个需要离屏渲染的子视图，对每个子视图分别开启光栅化并不会优化性能，反而可能造成性能下降。
TableView相关优化
基础优化

最大程度利用重用机制(差异性属性放在初始化之外，并且条件判断尽量覆盖所有情况,复用view和某些开销大的对象);
cell使用轻量级对像，CALayer的创建比UIView节省CPU资源，避免使用Xib创建cell;
当view不透明时，尽量将opaque设置为YES,可以减少GPU混合绘制消耗;
性能敏感 的tableView使用手动计算cell高度，避免使用AutoLayout;

UITableView在快速滑动时的异步线程处理
通常在加载UITableViewCell内容时会发送异步请求数据，然后回到UI线程加载内容，如果UITableView在快速滑动时创建大量异步请求(如加载网络图片)，当异步任务完成时大量UITableViewCell其实已经不在显示区域内而被销毁了，所以这些异步请求是没有意义的，虽然是异步请求，但过多的异步线程同样也会造成卡顿；
可做如下优化：
- (void)scrollViewDidEndDragging:(UIScrollView *)scrollView willDecelerate:(BOOL)decelerate {
  NSArray *visiblePaths = [self.tableView indexPathsForVisibleRows];
        for (NSIndexPath *indexPath in visiblePaths)
        {
          [self asyncRequest]; // 当tableView滑动停止时，就当cell 在可是区域内才发送异步请求
        }
}

