宏与静态常量
定义常量
.h //
extern NSString * const kConstExternFoo;
.m //
NSString * const kConstExternFoo = @"ConstExternFoo";

static全局变量 & static局部变量

局部变量:static修饰的局部变量延长了该变量的生命周期,任然只能局部访问，但当再次调用该局部区域（函数）时，该变量存储的是上次调用该局部区域的值，相当于只能"局部访问"的全局变量；

