删除Array的第一个元素



Object
JavaScript对象为动态类型，对象属性可以自由添加删除：
var ass = {
    name: 'hole'
};
ass.age; // undefined
ass.age = 40; // 新增一个age属性
ass.age; // 40
delete ass.age; // 删除age属性
in用于判断对象及其父对象是否拥有一个属性或者方法;
hasOwnProperty用于判断对象是否拥有一个属性;
var ass = {
