'join' in mobile  //true in关键字可以判定是否包含属性和方法
Iterable
集合类型的遍历有for ... in,for ... of,forEach()三种方式：
for … in遍历集合对象的属性/key：
var a = ['A', 'B', 'C'];
a.name = 'Hello';
for (var x in a) {
    alert(x); // '0', '1', '2', 'name'
}
for ... of遍历集合对象的键值/value：
var a = ['A', 'B', 'C'];
a.name = 'Hello';
