'use strict';
const PI = 3.14;
PI = 3; // 某些浏览器不报错，但是无效果！
PI; // 3.14
this
以下代码this的指代都很清楚：
function getAge() {
    var y = new Date().getFullYear();
    return y - this.birth;
}

var ass = {
