Gear/Cocoapods.html.body:
Cocoapods
基础使用
可以参考：

Cocoapods Guide
用CocoaPods做iOS程序的依赖管理
使用Cocoapods创建私有podspec

模块化方案
总体思想
将APP根据业务板块拆分为若干个cocoapods私有本地pods，将基础性的公用代码（基础工具类，公用UI组件等）单独创建一个模块（本地pods），其他模块依赖与该公用模块，主工程只需要放入统筹各个模块的代码（appdelegate,tabbarcontroller，模块间的通信实现等），将各个子模块连接在一起；
优点

减少业务代码耦合性；
便于多人合作任务分工，避免代码合并冲突；
加快编译效率，测试代码只需编译所在子模块；
对于大型项目，后期便于维护；

缺点

需要开发者对业务所属模块有清晰的认识；
建立模块化的过程相对复杂，需要对Cocoapods有较为深入的了解；
使用不当会造成App包体积增大；

具体实现

创建私有库

pod lib create UP-base

配置podspec文件:
Pod::Spec.new do |s|
  s.name             = 'UP-base'
  s.version          = '0.1.0'
  s.summary          = 'A short description of UP-base.'

  s.homepage         = 'https://github.com/nicreals/UP-base'
  s.license          = { :type => 'MIT', :file => 'LICENSE' }
  s.author           = { 'nicreals' => 'nic.reals@outlook.com' }
  s.source           = { :git => 'https://github.com/nicreals/UP-base.git', :tag => s.version.to_s }


  s.platform     = :ios, '7.0'
  s.source_files = 'UP-base/Classes/**/*.{h,m}' //指定源文件路径
  s.resources = 'UP-base/Assets/**/*.png' // 指定资源文件路径
  # s.prefix_header_file = 'UP-base/Classes/UPBase.pch' //指定pch文件路径
  s.dependency 'Masonry' // 设置依赖库
end


主工程集成

在主工程目录创建Podfile并配置自工程路径：
生成Podfile:
pod init

配置Podfile:
platform :ios, '7.0'
workspace 'UP_GuPiaoTong'

def podlibs
    pod 'UP-mine', :path => '~/Documents/UpChina/UP-mine'
    pod 'UP-market', :path => '~/Documents/UpChina/UP-market'
    pod 'UP-base', :path => '~/Documents/UpChina/UP-base'
end

target 'UP_GuPiaoTong' do
  podlibs
end

集成：
pod install --no-repo-update


模块间通讯实现

在子模块定义接口协议:
@protocol UPBaseRouterDelegate 

- (void)base:(UIViewController *)base goLoginWithComplete:(void (^)(BOOL success))complete;

@end

@interface UPBaseRouter : NSObject

@property (nonatomic, weak) id delegate;

+ (UPBaseRouter *)shareInstance;

@end

主工程中实现协议:
//UPBaseRouterManager
- (void)base:(UIViewController *)base goLoginWithComplete:(void (^)(BOOL))complete {
    self.loginBlock = complete;
    UPLoginViewController *login = [[UPLoginViewController alloc] init];
    login.hidesBottomBarWhenPushed = YES;
    login.delegate = self;
    UINavigationController *nav = [[UINavigationController alloc] initWithRootViewController:login];
    [base presentViewController:nav animated:YES completion:nil];
}

- (void)didLoginSuccess:(BOOL)success {
    NSLog(@"%@",@(success));
    self.loginBlock(success);
}

@end

模块间调用:
- (void)goLogin:(UIButton *)sender {
    [[UPBaseRouter shareInstance].delegate base:self goLoginWithComplete:^(BOOL success) {
        [self.loginButton setTitle:@"已登陆" forState:UIControlStateNormal];
        NSLog(@"登陆成功 - market");
    }];
}

优化
减少文件路径层级
直接将子模块所有文件放在模块第一级目录，同时如下设置podspec:
s.source_files = '**/*.{h,m,pch}'
s.resources = 'Assets/**/*.png'
s.exclude_files = 'Example/**/*'

优化代码提示
优化主工程调用子工程的代码提示
在build setting -> user header search paths 添加"${PODS_ROOT}/"路径
优化子模块的代码提示

设置pch文件:

s.prefix_header_file = 'UP-Base.pch'

这样可以使模块内部可直接使用pch文件中定义的类。

设置外部头文件:

s.public_header_files = 'UP-Base.h'

同时要注释掉主工程的Podfile中的use_framework!;
这样可以在新建文件时自动倒入该文件的父类(前提是UP-Base.h中定义了该类)

CS/Design-Pattern.html.body:
Design Pattern

iOS 设计模式之旅
MVC,MVP,MMVM,VIPER设计模式区别
MVC,MVP,MMVM图示

在软件设计领域，设计模式是对通用问题的可复用的解决方案。设计模式是一系列帮你写出更可理解和复用代码的模板，设计模式帮你创建松耦合的代码以便你不需要费多大力就可以改变或者替换代码中的组件。
MVC模式
理想状态下的MVC结构：

模型会把任何数据的变更通知控制器，然后控制器更新视图数据。视图对象通知控制器用户的操作，控制器要么根据需要来更新模型，要么检索任何被请求的数据。
Model: 模型保存应用程序的数据，定义了怎么去操作它;
View: 视图是模型的可视化表示以及用户交互的控件；基本上来说，所有的UIView对象以及它的子类都属于视图;
Controller: 控制器是一个协调所有工作的中介者（Mediator）。它访问模型中的数据并在视图中展示它们，同时它们还监听事件和根据需要操作数据;
实际中Model和View容易耦合在一起，并且Controller非常臃肿，不利于但愿测试。
MVP模式

MVP模式将Controller变为Presenter,同时各组件之间的通信方向发生改变。

各部分之间的通信，都是双向的。
View 与 Model 不发生联系，都通过 Presenter 传递。
View不参与任何逻辑，称为被动视图(Passive View),而所有逻辑都放在了Presenter中
相对于MVC模式开发速度会降低，但是View和Model不再耦合，结构更清晰，利于单元测试。

MMVM模式

单例模式
单例模式确保一个类只有一个实例存在，并且该实例可以全局访问。
Objective-C中的单例实现：
+ (ShareClass *)sharedInstance {
    static ShareClass *_share = nil;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        _share = [[self alloc] init];
    });
    return _share;
}
Swift中的单例实现：
class ShareClass {
    public static let shared : ShareClass = ShareClass()
    private init() {}
}
外观(Facade)模式
外观模式将细节封装起来，多个类实现的功能只暴露单一的接口，降低了用户对内部细节的依赖性，当内部实现细节发生变化时，外观模式保持原样的接口，降低了项目的维护难度。
